import React from 'react';
import './App.css';

const App = () => {
  return(
    <div className='App'>
      <label>First Name:</label>
      <input type="text" />
      <label>Last Name:</label>
      <input type="text" />
      <label>Phone Number:</label>
      <input type="number" />
      <button>Add Contact</button>
    </div>
  )
};



export default App;
